import React, { useState, useEffect } from 'react';
import { BarChart, LineChart, CartesianGrid, XAxis, YAxis, Tooltip, Bar, Line } from 'recharts';
import { Card, CardHeader, CardTitle, CardDescription, CardContent } from '../components/ui/Card'; // Custom Card Components

const API_BASE_URL = 'http://localhost:5000/api';

const CustomerAnalytics = ({ customerId }) => {
  const [analytics, setAnalytics] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (!customerId) return;

    setLoading(true);
    setError(null);
    
    fetch(`${API_BASE_URL}/analytics/customer/${customerId}`)
      .then((res) => {
        if (!res.ok) {
          throw new Error('Failed to fetch analytics');
        }
        return res.json();
      })
      .then((data) => {
        console.log('Received analytics data:', data); // Debug log
        setAnalytics(data);
        setLoading(false);
      })
      .catch((err) => {
        console.error('Error fetching customer analytics:', err);
        setError('Error fetching analytics data.');
        setLoading(false);
      });
  }, [customerId]);

  if (!customerId) return <div className="p-4 text-center text-gray-500">Please select a customer to view analytics.</div>;
  if (loading) return <div className="p-4 text-center text-gray-500">Loading customer analytics...</div>;
  if (error) return <div className="p-4 text-center text-red-500">{error}</div>;
  if (!analytics || Object.keys(analytics).length === 0) {
    return <div className="p-4 text-center text-gray-500">No analytics data available for this customer.</div>;
  }

  // Transform data for charts
  const intentData = Object.entries(analytics.intent_distribution || {}).map(([intent, count]) => ({
    intent: intent || 'Unknown',
    count: count || 0,
  }));

  const propertyData = Object.entries(analytics.property_interest || {}).map(([property, count]) => ({
    property: property || 'Unknown',
    count: count || 0,
  }));

  const timelineData = Object.entries(analytics.interaction_timeline || {}).map(([date, count]) => ({
    date,
    interactions: count || 0,
  }));

  // Don't render charts if no data
  const hasIntentData = intentData.length > 0;
  const hasPropertyData = propertyData.length > 0;
  const hasTimelineData = timelineData.length > 0;

  return (
    <div className="grid gap-4 md:grid-cols-2 xl:grid-cols-3">
      {hasIntentData ? (
        <Card>
          <CardHeader>
            <CardTitle>Intent Distribution</CardTitle>
            <CardDescription>Customer interaction purposes</CardDescription>
          </CardHeader>
          <CardContent>
            <BarChart width={400} height={300} data={intentData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="intent" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="count" fill="#8884d8" />
            </BarChart>
          </CardContent>
        </Card>
      ) : (
        <Card>
          <CardHeader>
            <CardTitle>Intent Distribution</CardTitle>
            <CardDescription>No intent data available</CardDescription>
          </CardHeader>
        </Card>
      )}

      {hasPropertyData ? (
        <Card>
          <CardHeader>
            <CardTitle>Property Interest</CardTitle>
            <CardDescription>Properties viewed or inquired about</CardDescription>
          </CardHeader>
          <CardContent>
            <BarChart width={400} height={300} data={propertyData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="property" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="count" fill="#82ca9d" />
            </BarChart>
          </CardContent>
        </Card>
      ) : (
        <Card>
          <CardHeader>
            <CardTitle>Property Interest</CardTitle>
            <CardDescription>No property interest data available</CardDescription>
          </CardHeader>
        </Card>
      )}

      {hasTimelineData ? (
        <Card className="md:col-span-2 xl:col-span-3">
          <CardHeader>
            <CardTitle>Interaction Timeline</CardTitle>
            <CardDescription>Customer interactions over time</CardDescription>
          </CardHeader>
          <CardContent>
            <LineChart width={800} height={300} data={timelineData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="date" />
              <YAxis />
              <Tooltip />
              <Line type="monotone" dataKey="interactions" stroke="#8884d8" />
            </LineChart>
          </CardContent>
        </Card>
      ) : (
        <Card className="md:col-span-2 xl:col-span-3">
          <CardHeader>
            <CardTitle>Interaction Timeline</CardTitle>
            <CardDescription>No interaction timeline data available</CardDescription>
          </CardHeader>
        </Card>
      )}
    </div>
  );
};

export default CustomerAnalytics;
